import React from 'react';
import Forgot from './Components/ForgotPassword.js';
import SignupForm from './Components/Signup.js';
import Login from './Components/Login.js';
import PasswordChanged from './Components/PasswordChanged.js';
import Scan from './Components/Scan.js';
import Scanner from './Components/Scanner.js';
import PasswordReset from './Components/Newpassword.js';
import EventOrganizers from './Components/SuperEvent.js';

function App() {
  return (
    <>
      <SignupForm />
      <Forgot />
      <Login />
      <PasswordChanged />
      <Scan />
      <Scanner />
      <PasswordReset />
      <EventOrganizers/>
    </>
  );
}

export default App;
